    return(
        <section className="home">

            <div className="textContent">
                <h1 className="homeTitle">Welcome to ChefSteps!</h1>
                <p className="homeParagraph">We’re here to help you go from curious cook to confident in the kitchen.</p>
            </div>

            <div className="homeContainer">
                <img className="bgImage" src="../../../public/images/Corned-Beef-05.jpg" alt="Corned-Beef-05.jpg" />
            </div>
        </section>
    );
}

